import React from 'react';
import { components } from 'data';
import { ComponentDetails as ComponentDetailsView } from 'views';

export default function ComponentDetails({ item }) {
  return <ComponentDetailsView item={item} />;
}

export async function getStaticProps({ params }) {
  const { key } = params;

  const component = components.find((item) => item.key === key);

  return {
    props: {
      item: component,
    },
  };
}

export async function getStaticPaths() {
  return {
    paths: components.map((item) => `/component/${item.key}`),
    fallback: false,
  };
}
